import React from 'react';
import { Link } from 'react-scroll';
import './hero.css';
import craneImage from './img/crane.png';
import fondoRecorte from './img/FONDO.png';

function Home() {
  return (
    <div className="hero">
      <header className="header">
        <img src={craneImage} alt="Logo de RPM PROYECTOS" className="logo" />
        <nav>
          <Link to="home" smooth={true} duration={500} className="nav-link">Inicio</Link>
          <Link to="nosotros" smooth={true} duration={500} className="nav-link">Nosotros</Link>
          <Link to="obras" smooth={true} duration={500} className="nav-link">Obras</Link>
          <Link to="clientes" smooth={true} duration={500} className="nav-link">Clientes</Link>
          <Link to="contacto" smooth={true} duration={500} className="nav-link">Contacto</Link>
        </nav>
      </header>
      <h1>SERVICIOS DE PROYECTOS DE INGENIERÍA Y ARQUITECTURA</h1>
      <p>Es decir todo lo que es el proyecto...</p>
      <Link to="contacto" smooth={true} duration={500} className="hero-button">
        MÁS INFORMACIÓN
      </Link>
      <img src={fondoRecorte} alt="Recorte negro" className="overlay-cut" />
      <img src={craneImage} alt="Grúa" className="crane" />
    </div>
  );
}

export default Home;
